using System.Collections.Generic;
using System.Threading.Tasks;
using Microsoft.EntityFrameworkCore;
using MealBox.API.Models;

namespace MealBox.API.Data
{
    public static class MealImageSeeder
    {
        public static async Task SeedMealImages(ApplicationDbContext context)
        {
            var mealImages = new Dictionary<string, string>
            {
                { "Spaghetti Bolognese", "https://images.ctfassets.net/uexfe9h31g3m/6QtnhruEFi8qgEyYAICkyS/ab01e9b1da656f35dd1a721c810162a0/Spaghetti_bolognese_4x3_V2_LOW_RES.jpg?q=90&w=1200&h=600" },
                { "Chicken Caesar Salad", "assets/images/caesar-salad.jpg" },
                { "Margherita Pizza", "https://safrescobaldistatic.blob.core.windows.net/media/2022/11/PIZZA-MARGHERITA.jpg" },
                { "Beef Burger", "https://encrypted-tbn0.gstatic.com/images?q=tbn:ANd9GcQy1XC7XeILClfCJEaGDBj5EXXUt556mXDGXg&s" },
                { "Sushi Platter", "https://i.redd.it/84obefjhqt6b1.jpg" },
                { "Grilled Salmon", "https://encrypted-tbn0.gstatic.com/images?q=tbn:ANd9GcQ6wQkenmtvISq0DyTFwvdmHUinFIuUksJXFg&s" },
                { "Vegan Buddha Bowl", "https://i2.wp.com/hipfoodiemom.com/wp-content/uploads/2017/05/buddha-bowl_3193_fb.jpg" },
                { "Chocolate Cake", "https://encrypted-tbn0.gstatic.com/images?q=tbn:ANd9GcRast9gcrS_wMDqhDghJeMC8Ofo_sNFweA7ng&s" }
            };

            foreach (var meal in await context.Meals.ToListAsync())
            {
                if (mealImages.ContainsKey(meal.Name))
                {
                    meal.ImageUrl = mealImages[meal.Name];
                }
                else
                {
                    meal.ImageUrl = "data:image/jpeg;base64,";
                }
            }

            await context.SaveChangesAsync();
        }
    }
}
